import React, { Component } from 'react';

class List extends Component {
  constructor(props) {
    super(props);
   
    this.state = {
        data: ["1","2"],
      };
}
  render() {
      //works for array
   
      var li =this.state.data.map(function(item, i){
        console.log('test');
        return <li key={i}>Test</li>
      })

      //doesn't work for array of objects
      

      return (
          <ul>
              //works
              {li}
              <p>object</p>
             
          </ul>
      )
  }
}

export default List;
